<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style="font-size: 20px; font-family: Arial, Helvetica, sans-serif;">Grafik DWT (Deadweight Tonnage) kapal, yang menunjukkan kapasitas angkut kapal yang datang ke pelabuhan, juga mengalami pola fluktuasi yang cukup signifikan sepanjang tahun. Pada bulan Januari, kapasitas DWT tercatat sebesar 1.517.262 ton, kemudian mengalami lonjakan signifikan sebesar 39% di bulan Februari menjadi 2.105.326 ton. Lonjakan ini menunjukkan peningkatan jumlah kapal berkapasitas besar yang datang pada awal tahun, mungkin sebagai dampak peningkatan aktivitas perdagangan. Namun, pada bulan Maret, kapasitas DWT mengalami penurunan sebesar 6% menjadi 1.970.751 ton, yang mencerminkan adanya penurunan kapasitas muatan kapal yang beroperasi di pelabuhan. Tren kembali membaik pada bulan April dengan peningkatan sebesar 15% menjadi 2.270.669 ton, diikuti oleh kenaikan sebesar 11% di bulan Mei yang mencapai 2.528.835 ton. Stabilitas tercatat pada bulan Juni, di mana kapasitas DWT tetap di angka 2.537.261 ton tanpa adanya perubahan signifikan. Namun, pada bulan Juli, terjadi penurunan sebesar 14% menjadi 2.173.399 ton, yang kemungkinan disebabkan oleh pergantian jadwal kapal atau berkurangnya permintaan. Tren ini kemudian berbalik positif pada bulan Agustus, dengan kenaikan tipis sebesar 3% menjadi 2.246.066 ton, diikuti peningkatan lebih besar sebesar 9% di bulan September yang mencapai 2.460.061 ton. Puncak DWT tercatat di bulan Oktober dengan kapasitas sebesar 2.786.828 ton, naik 13%, yang menandakan adanya peningkatan kapal besar untuk mengakomodasi muatan pada periode tersebut. Namun, tren ini tidak berlanjut menjelang akhir tahun, di mana kapasitas DWT turun tajam sebesar 23% di bulan November ke angka 2.153.262 ton, dan puncak penurunan terjadi pada bulan Desember dengan angka hanya 984.684 ton, turun drastis sebesar 58%. Penurunan signifikan ini mencerminkan berkurangnya kapal besar yang datang di akhir tahun, yang sejalan dengan tren penurunan kunjungan kapal dan volume muatan. Penurunan ini kemungkinan besar terjadi karena musim liburan, penurunan aktivitas perdagangan, atau faktor permintaan pasar.</span></p>
