<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'><span style="font-size: 16px; font-family: Arial, Helvetica, sans-serif;">&nbsp;</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style="font-size: 20px; font-family: Arial, Helvetica, sans-serif;">Grafik muatan bongkar muat (B/M) juga menunjukkan pola fluktuasi yang signifikan sepanjang tahun, dengan beberapa bulan mencatat lonjakan aktivitas yang cukup tinggi, sementara beberapa bulan lainnya mengalami penurunan drastis. Pada bulan Januari, jumlah muatan tercatat sebesar 692.657 ton, kemudian naik signifikan sebesar 35% menjadi 933.583 ton pada bulan Februari. Kenaikan ini mencerminkan peningkatan signifikan dalam aktivitas logistik di awal tahun. Namun, pada bulan Maret, terjadi penurunan sebesar 11% ke angka 833.125 ton, menunjukkan adanya perlambatan atau penurunan permintaan. Penurunan ini berlanjut di bulan April dengan penurunan tipis sebesar 5% ke angka 795.618 ton. Tren kemudian berbalik positif pada bulan Mei, di mana muatan mengalami kenaikan signifikan sebesar 24% menjadi 983.882 ton, yang mengindikasikan pemulihan aktivitas pengiriman barang setelah dua bulan mengalami penurunan. Pada bulan Juni, angka kembali turun 10% ke 881.218 ton sebelum mengalami lonjakan signifikan sebesar 20% di bulan Juli, mencapai angka 1.053.064 ton. Kenaikan ini menunjukkan adanya peningkatan aktivitas perdagangan di tengah tahun, yang bisa berkaitan dengan lonjakan permintaan pasar atau periode puncak pengiriman. Pada bulan Agustus, meskipun terjadi penurunan sebesar 2%, volume muatan masih stabil di angka 1.034.763 ton, tetapi kembali mengalami penurunan sebesar 9% di bulan September ke 944.765 ton. Pemulihan terjadi lagi di bulan Oktober dengan peningkatan sebesar 8% menjadi 1.016.071 ton. Namun, menjelang akhir tahun, aktivitas kembali mengalami penurunan drastis. Pada bulan November, muatan turun sebesar 15% menjadi 850.419 ton, dan puncak penurunan terjadi di bulan Desember dengan angka hanya 329.064 ton, turun tajam sebesar 62%. Penurunan ini mungkin disebabkan oleh berkurangnya aktivitas perdagangan menjelang akhir tahun, faktor musiman, atau adanya penurunan permintaan pasar global dan domestik.</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'><span style="font-size: 16px; font-family: Arial, Helvetica, sans-serif;">&nbsp;</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:center;'><span style="font-size: 16px; font-family: Arial, Helvetica, sans-serif;"><img width="607" src="data:image/png;base64," alt="image"></span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:center;line-height:normal;'><span style="font-size: 16px; font-family: Arial, Helvetica, sans-serif;">Gambar 5 Grafik Total Muatan Bongkar/Muat di UPP Indramayu tahun 2024</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style="font-size: 16px; line-height: 107%; font-family: Arial, Helvetica, sans-serif;">&nbsp;</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style="font-size: 20px; line-height: 107%; font-family: Arial, Helvetica, sans-serif;">Secara keseluruhan, ketiga grafik tersebut menunjukkan pola yang serupa, di mana puncak aktivitas terjadi pada pertengahan tahun, khususnya pada bulan Juli, September, dan Oktober. Hal ini menandakan bahwa periode tersebut adalah waktu puncak aktivitas perdagangan dan pengiriman logistik di pelabuhan. Namun, tren menurun signifikan terlihat menjelang akhir tahun, terutama pada bulan Desember, di mana semua indikator &ndash; kunjungan kapal, volume muatan, dan kapasitas DWT &ndash; mengalami penurunan tajam. Penurunan ini kemungkinan besar dipengaruhi oleh faktor musiman, seperti liburan akhir tahun, berkurangnya permintaan logistik, atau kendala operasional di pelabuhan. Fluktuasi yang terjadi sepanjang tahun juga menunjukkan adanya dinamika perdagangan dan aktivitas pelayaran yang dipengaruhi oleh permintaan pasar, kondisi cuaca, serta jadwal operasional kapal. Optimalisasi operasional pelabuhan di periode puncak dan strategi untuk mengatasi penurunan di akhir tahun dapat menjadi kunci dalam meningkatkan efisiensi dan stabilitas aktivitas pelabuhan di masa mendatang.</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style="font-size: 20px; line-height: 107%; font-family: Arial, Helvetica, sans-serif;">Grafik dibawah menggambarkan &quot;Jumlah Muatan Berdasarkan Asal Kapal&quot; yang terbagi ke dalam dua kategori utama: muatan dari kapal <strong>dalam negeri</strong> dan <strong>luar negeri</strong> selama 12 bulan. Berikut adalah analisis mendetailnya:</span></p>
<div style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
    <ol style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
        <li style="margin: 0cm 0cm 8pt; font-size: 20px; font-family: Arial, Helvetica, sans-serif;"><strong><span style="line-height: 107%;">Tren Umum</span></strong><span style="line-height: 107%;">:</span></li>
    </ol>
</div>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:18.0pt;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style="font-size: 20px; line-height: 107%; font-family: Arial, Helvetica, sans-serif;">Secara keseluruhan, muatan dari kapal dalam negeri secara konsisten mendominasi jumlah total muatan dibandingkan kapal luar negeri di setiap bulan. Hal ini menunjukkan bahwa kontribusi muatan domestik lebih signifikan dalam aktivitas pengangkutan secara keseluruhan.</span></p>
<div style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
    <ol start="2" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
        <li style="margin: 0cm 0cm 8pt; font-size: 20px; font-family: Arial, Helvetica, sans-serif;"><strong><span style="line-height: 107%;">Performa Bulanan</span></strong><span style="line-height: 107%;">:</span></li>
    </ol>
</div>
<ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
    <li style="margin: 0cm 0cm 0.0001pt; font-size: 20px; font-family: Arial, Helvetica, sans-serif; text-align: justify;"><span style="line-height: 107%;">Pada bulan <strong>4 (April)</strong> dan <strong>5 (Mei)</strong>, jumlah muatan mencapai puncak tertinggi, yaitu masing-masing sebesar <strong>1.211.947 ton</strong> dan <strong>1.352.431 ton</strong>. Hal ini didorong oleh tingginya kontribusi dari kapal dalam negeri yang masing-masing menyumbang <strong>878.508 ton</strong> dan <strong>981.729 ton</strong>.</span></li>
    <li style="margin: 0cm 0cm 0.0001pt; font-size: 20px; font-family: Arial, Helvetica, sans-serif; text-align: justify;"><span style="line-height: 107%;">Bulan dengan muatan terendah adalah bulan <strong>12 (Desember)</strong>, dengan total muatan hanya <strong>432.885 ton</strong>. Penurunan ini sangat signifikan dibandingkan bulan lainnya dan terutama dipengaruhi oleh rendahnya muatan dari kapal luar negeri sebesar <strong>107.426 ton</strong>.</span></li>
</ul>
<div style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
    <ol start="3" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
        <li style="margin: 0cm 0cm 8pt; font-size: 20px; font-family: Arial, Helvetica, sans-serif;"><strong><span style="line-height: 107%;">Kontribusi Kapal Luar Negeri</span></strong><span style="line-height: 107%;">:&nbsp;</span></li>
    </ol>
</div>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:18.0pt;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style="font-size: 20px; line-height: 107%; font-family: Arial, Helvetica, sans-serif;">Kontribusi kapal luar negeri menunjukkan fluktuasi yang signifikan. Bulan dengan muatan kapal luar negeri tertinggi adalah bulan <strong>10 (Oktober)</strong> dengan <strong>516.315 ton</strong>, sementara bulan dengan kontribusi terendah adalah bulan <strong>12 (Desember)</strong> dengan <strong>107.426 ton</strong>. Bulan Oktober menjadi anomali yang menarik karena terjadi lonjakan besar pada muatan luar negeri dibandingkan bulan lainnya.</span></p>
<div style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
    <ol start="4" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
        <li style="margin: 0cm 0cm 8pt; font-size: 20px; font-family: Arial, Helvetica, sans-serif;"><strong><span style="line-height: 107%;">Stabilitas Muatan Dalam Negeri</span></strong><span style="line-height: 107%;">:</span></li>
    </ol>
</div>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:18.0pt;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style="font-size: 20px; line-height: 107%; font-family: Arial, Helvetica, sans-serif;">Kapal dalam negeri menunjukkan tren yang lebih stabil dibandingkan kapal luar negeri. Angka muatan cenderung berada di kisaran <strong>564.971 ton</strong> (bulan 1) hingga <strong>984.525 ton</strong> (bulan 8), dengan puncak terjadi pada bulan <strong>5 (981.729 ton)</strong>. Hal ini mencerminkan adanya permintaan yang konsisten terhadap layanan kapal dalam negeri.</span></p>
<div style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
    <ol start="5" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
        <li style="margin: 0cm 0cm 8pt; font-size: 20px; font-family: Arial, Helvetica, sans-serif;"><strong><span style="line-height: 107%;">Perbandingan Kapal Dalam Negeri dan Luar Negeri</span></strong><span style="line-height: 107%;">:</span></li>
    </ol>
</div>
<ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
    <li style="margin: 0cm 0cm 0.0001pt; font-size: 20px; font-family: Arial, Helvetica, sans-serif; text-align: justify;"><span style="line-height: 107%;">Kontribusi kapal dalam negeri terhadap total muatan di setiap bulan secara rata-rata lebih dari 65%.</span></li>
    <li style="margin: 0cm 0cm 0.0001pt; font-size: 20px; font-family: Arial, Helvetica, sans-serif; text-align: justify;"><span style="line-height: 107%;">Namun, pada bulan 10 (Oktober), kapal luar negeri memberikan kontribusi yang signifikan hingga mencapai hampir 36% dari total muatan bulanan.</span></li>
</ul>
<div style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
    <ol start="6" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
        <li style="margin: 0cm 0cm 8pt; font-size: 20px; font-family: Arial, Helvetica, sans-serif;"><strong><span style="line-height: 107%;">Analisis Musiman</span></strong><span style="line-height: 107%;">:</span></li>
    </ol>
</div>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:18.0pt;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style="font-size: 20px; line-height: 107%; font-family: Arial, Helvetica, sans-serif;">Lonjakan signifikan pada bulan <strong>4 (April)</strong> dan <strong>5 (Mei)</strong> kemungkinan disebabkan oleh faktor musiman seperti peningkatan aktivitas pengangkutan menjelang hari raya atau musim panen tertentu. Sebaliknya, penurunan drastis pada bulan <strong>12 (Desember)</strong> bisa disebabkan oleh faktor cuaca, akhir tahun, atau penurunan permintaan</span><span style='font-size: 20px; line-height: 107%; font-family: "Amasis MT Pro", serif;'>.</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size: 20px; line-height: 107%; font-family: "Amasis MT Pro", serif;'>&nbsp;</span></p>
