<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style="font-size: 20px; line-height: 107%; font-family: Arial, Helvetica, sans-serif;">Data ini menunjukkan dominasi kapal dalam negeri dalam kegiatan muatan sepanjang tahun dengan kontribusi yang stabil. Sementara itu, kapal luar negeri memberikan kontribusi yang lebih kecil namun tidak dapat diabaikan, terutama pada bulan-bulan tertentu seperti Oktober. Penurunan yang signifikan pada bulan Desember perlu menjadi perhatian untuk memahami penyebab pastinya dan memitigasi potensi penurunan serupa di masa depan.</span></p>
